import React from "react";
import r1 from "../images/r2.png";
import r2 from "../images/r3.png";
import r3 from "../images/r4.png";
import r4 from "../images/r1.png";
import r5 from "../images/r5.png";
import r6 from "../images/r6.png";
import r7 from "../images/r7.png";
import r8 from "../images/r8.png";
import r9 from "../images/r9.png";
import r10 from "../images/r10.png";
import r11 from "../images/r11.png";
import r12 from "../images/r12.png";
import r13 from "../images/r13.png";
import r14 from "../images/r14.png";
import r15 from "../images/r15.png";
import r16 from "../images/r16.png";
import r17 from "../images/r17.png";
import r18 from "../images/r18.png";
import r19 from "../images/r19.png";
import r20 from "../images/r20.png";

// import r9 from "../images/r9.png";
// import p1 from "../images/p1.jpg";

const Review = () => {
  const goToTop = () => {
    window.scrollTo({
      top: 0,
      behavior: "instant",
    });
  };
  goToTop();
  return (
    <div>
      <div>
        <div>
          <div className="gHeader">
            <h2>About us</h2>
          </div>
          <div className="gdivideSection" style={{}}>
            <div className="">
              <div>
                <h2 style={{ color: "#506383" }}>Customers Rave</h2>

                <p>
                  Chances are you're ready to sell but would like to see what
                  customers say. Sounds good to us. We encourage it.
                </p>
              </div>
              <br />
              <b style={{ color: "black" }}>What our customers are saying...</b>
              <div>
                <div>
                  <img
                    src={r1}
                    alt="Girl in a jacket"
                    //   style={{ width: "60px", height: "75px" }}
                  />
                </div>
                <div>
                  <img
                    src={r2}
                    alt="Girl in a jacket"
                    //   style={{ width: "60px", height: "75px" }}
                  />
                </div>
                <div>
                  <img
                    src={r3}
                    alt="Girl in a jacket"
                    //   style={{ width: "60px", height: "75px" }}
                  />
                </div>
                <div>
                  <img
                    src={r4}
                    alt="Girl in a jacket"
                    //   style={{ width: "60px", height: "75px" }}
                  />
                </div>
                <div>
                  <img
                    src={r5}
                    alt="Girl in a jacket"
                    //   style={{ width: "60px", height: "75px" }}
                  />
                </div>
                <div>
                  <img
                    src={r6}
                    alt="Girl in a jacket"
                    //   style={{ width: "60px", height: "75px" }}
                  />
                </div>
                <div>
                  <img
                    src={r7}
                    alt="Girl in a jacket"
                    //   style={{ width: "60px", height: "75px" }}
                  />
                </div>
                <div>
                  <img
                    src={r8}
                    alt="Girl in a jacket"
                    //   style={{ width: "60px", height: "75px" }}
                  />
                </div>
                <div>
                  <img
                    src={r9}
                    alt="Girl in a jacket"
                    //   style={{ width: "60px", height: "75px" }}
                  />
                </div>
                <div>
                  <img
                    src={r10}
                    alt="Girl in a jacket"
                    //   style={{ width: "60px", height: "75px" }}
                  />
                </div>
                <div>
                  <img
                    src={r11}
                    alt="Girl in a jacket"
                    //   style={{ width: "60px", height: "75px" }}
                  />
                </div>
                <div>
                  <img
                    src={r12}
                    alt="Girl in a jacket"
                    //   style={{ width: "60px", height: "75px" }}
                  />
                </div>
                <div>
                  <img
                    src={r13}
                    alt="Girl in a jacket"
                    //   style={{ width: "60px", height: "75px" }}
                  />
                </div>
                <div>
                  <img
                    src={r14}
                    alt="Girl in a jacket"
                    //   style={{ width: "60px", height: "75px" }}
                  />
                </div>
                <div>
                  <img
                    src={r15}
                    alt="Girl in a jacket"
                    //   style={{ width: "60px", height: "75px" }}
                  />
                </div>
                <div>
                  <img
                    src={r16}
                    alt="Girl in a jacket"
                    //   style={{ width: "60px", height: "75px" }}
                  />
                </div>
                <div>
                  <img
                    src={r17}
                    alt="Girl in a jacket"
                    //   style={{ width: "60px", height: "75px" }}
                  />
                </div>
                <div>
                  <img
                    src={r18}
                    alt="Girl in a jacket"
                    //   style={{ width: "60px", height: "75px" }}
                  />
                </div>
                <div>
                  <img
                    src={r19}
                    alt="Girl in a jacket"
                    //   style={{ width: "60px", height: "75px" }}
                  />
                </div>
                <div>
                  <img
                    src={r20}
                    alt="Girl in a jacket"
                    //   style={{ width: "60px", height: "75px" }}
                  />
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Review;
